const getNastavnici = (state = [], action) => {
  /* if (action.type === 'GET_NASTAVNICI') {
    return state;
  } */
  if (action.type === 'GET_NASTAVNICI') {
    const nast = fetch('http://localhost:3001/nastavnici')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
      });
    return nast;
  }
  return state;
};

export default getNastavnici;
